import * as React from 'react';
import './App.css'
import dayjs, { Dayjs } from 'dayjs';
import Stack from '@mui/material/Stack';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { DesktopDatePicker } from '@mui/x-date-pickers/DesktopDatePicker';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import ApexChart from './CandleChart.js';
class FormPropsTextFields extends React.Component {
	constructor(props) {
    super(props);
    this.state = {
			valueEnd: React.useState(dayjs('2014-08-18T21:11:54')),
			valueStart: React.useState(dayjs('2014-08-18T21:11:54')),
			valueTicker: "TSLA",
		};
  }
	async componentDidMount(){
		this.setState({
			valueEnd: React.useState(dayjs('2014-08-18T21:11:54')),
			valueStart: React.useState(dayjs('2014-08-18T21:11:54')),
			valueTicker: "TSLA",
		})
	}
	handleChangeTicker(newValueTicker) {
		this.setState({valueTicker: newValueTicker});
	};
	handleChangeStartDate(newValueStartDate) {
		this.setState({valueStart: newValueStartDate});
	};
	handleChangeEndDate(newValueEndDate){
		this.setState({valueEnd: newValueEndDate});
	};
	onTrigger(){
		this.props.parentCallback(this.state.valueTicker);
	}
	render() {
		return (
		<div class="choiceButtons" id="choiceButtons">
		<LocalizationProvider dateAdapter={AdapterDayjs}>
			<Stack direction="row" spacing={2}>
				<TextField
					id="outlined"
					label="Ticker"
					type="text"
					Value={this.state.valueTicker}
					onChange={this.handleChangeTicker}
					inputProps={{ maxLength: 5 }}
				/>
				<DesktopDatePicker
					label="Start Date"
					inputFormat="MM/DD/YYYY"
					value={this.state.valueStart}
					onChange={this.handleChangeStartDate}
					renderInput={(params) => <TextField {...params} />}
				/>
				<DesktopDatePicker
					label="End Date"
					inputFormat="MM/DD/YYYY"
					value={this.state.valueEnd}
					onChange={this.handleChangeEndDate}
					renderInput={(params) => <TextField {...params} />}
				/>
				<Button variant="contained"
				onClick= {this.onTrigger} >Generate</Button>
			</Stack>
			</LocalizationProvider>
			<ApexChart />
		</div>
	);
	}
}
export default FormPropsTextFields;
